  <div>
	<h1 id="first">About Montezuma</h1>
	<h1 id="sec">Asset Backed Cryptocurrency</h1>


  <style jsx>{`
      	div {
			height: 550px;
			width: 100%;
			text-align: center;
			background: url('https://www.finance-monthly.com/Finance-Monthly/wp-content/uploads/2019/11/Crypto-750x400.jpg') no-repeat center center; 
			-webkit-background-size: cover;
			-moz-background-size: cover;
			-o-background-size: cover;
			background-size: cover;      	}
      	#first {
      		font-size: 60px;
      		position: absolute;
      		margin-top: 40px;
      		margin-left: 29%;
      		color: white;

      	}
      	#sec {
      		font-size: 30px;
      		position: absolute;
      		margin-top: 450px;
      		margin-left: 31%;
      		color: white;

      	}




      `}</style>  
  </div>

);

export default AboutHead;
